import math

def is_prime(n):
    if n < 1:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def print_square_of_primes(numbers):
    for num in numbers:
        if is_prime(num):
            print(num ** 2)

